import React from "react";

function Add(a, b) {
  var Sum = a + b;
  return Sum;
}

function Sub(a, b) {
    var Sum = a - b;
    return Sum;
  }

  function Mult(a, b) {
    var Sum = a * b;
    return Sum;
  }

  function Div(a, b) {
    var Sum = a / b;
    return Sum;
  }
export default Add;
export {Sub,Mult,Div}
